import { Flex, Image } from "@chakra-ui/react";

export default function Nav() {
    return (
        <Flex bg={'gray.200'} height='50px' padding='5px 10px' align={'center'}>
           <Flex>
            <Image src="./images/React.png" height={'40px'}/>
           </Flex>
        </Flex>
    )
}
